@abiirich 'Recovery' is such a dodgy concept; the assumption it means to return to how things were... nonsense.
We get knocked down, sometimes we get up again but sometimes we crawl onward on our knees. Sometimes we find our feet but have a permanent limp. Just keep moving, hon.
(((Hugs)))

